import React from "react";
import "./Home.css";

import { stockData } from "../Data";

class Home extends React.Component {
  render() {
    return (

          <div className="stock-container">

            {stockData.map((data, key) => {
              return (

                <div key={key}>
                  {data.company +
                    " , " +
                    data.ticker +
                    " ," +
                    data.stockPrice +
                    ", " +
                    data.timeElapsed}
                    <button>add to cart</button>
                </div>
              );
            })}
          </div>


    );
  }
}

export default Home;
